oxy_webhelp_navlinks = {"arch_amazon_s3-d23139e5262":{"topics":[{"title":"Archive preparation in Amazon S3","shortdesc":"<p class=\"shortdesc\">Preparing Amazon S3 storage for archiving involves creating a bucket with the         required permissions.<\/p>","href":"archival\/s3_archive_prep.html","attributes":{"data-id":"s3_archive_prep"},"menu":{"hasChildren":false},"tocID":"s3_archive_prep-d23139e5276","next":"s3_archive_prep-d23139e5276"},{"title":"Adding AWS cloud accounts with access keys for data center archival locations","shortdesc":"<p class=\"shortdesc\">To use Amazon S3 for archiving snapshots of data center workloads, add an AWS cloud         account for authentication with access keys.<\/p>","href":"archival\/adding_aws_cloud_account_ak_dc_arch_loc_2.html","attributes":{"data-id":"adding_aws_cloud_account_ak_dc_arch_loc"},"menu":{"hasChildren":false},"tocID":"adding_aws_cloud_account_ak_dc_arch_loc-d23139e5320","topics":[]},{"title":"Adding AWS cloud accounts with IAM roles to access data center archival locations","shortdesc":"<p class=\"shortdesc\">Add an AWS cloud account with IAM roles to authenticate access to Amazon S3 archival         locations.<\/p>","href":"archival\/add_aws_cld_accnt_iam_rbac_dc_arch_loc.html","attributes":{"data-id":"add_aws_cld_accnt_iam_rbac_dc_arch_loc"},"menu":{"hasChildren":false},"tocID":"add_aws_cld_accnt_iam_rbac_dc_arch_loc-d23139e5331","topics":[]},{"title":"Editing AWS cloud accounts for data center archival locations","shortdesc":"<p class=\"shortdesc\">Edit an AWS cloud account in <span class=\"ph\">RSC<\/span> for a data center archival location         to modify the AWS account name.<\/p>","href":"archival\/edit_aws_cloud_account_dc_archl_loc.html","attributes":{"data-id":"edit_aws_cloud_account_dc_archl_loc"},"menu":{"hasChildren":false},"tocID":"edit_aws_cloud_account_dc_archl_loc-d23139e5342","topics":[]},{"title":"Deleting AWS cloud accounts","shortdesc":"<p class=\"shortdesc\">Delete an AWS cloud account when you do not need the cloud account         anymore.<\/p>","href":"archival\/delete_aws_cloud_accnt_dc_arch_loc.html","attributes":{"data-id":"delete_aws_cloud_accnt_dc_arch_loc"},"menu":{"hasChildren":false},"tocID":"delete_aws_cloud_accnt_dc_arch_loc-d23139e5356","topics":[]},{"title":"Creating additional AWS IAM roles for data center archival locations","shortdesc":"<p class=\"shortdesc\">For an AWS cloud account in <span class=\"ph\">RSC<\/span>, create different IAM roles         corresponding to each data center to isolate access to your Amazon S3 archival         locations.<\/p>","href":"archival\/create_addnl_aws_iam_roles_dc_arch_loc.html","attributes":{"data-id":"create_addnl_aws_iam_roles_dc_arch_loc"},"menu":{"hasChildren":false},"tocID":"create_addnl_aws_iam_roles_dc_arch_loc-d23139e5367","topics":[]},{"title":"Editing AWS IAM roles for data center archival locations","shortdesc":"<p class=\"shortdesc\">Edit the details associated with an IAM role in <span class=\"ph\">RSC<\/span> for data center         archival locations in Amazon S3.<\/p>","href":"archival\/edit_aws_iam_roles_dc_arch_loc.html","attributes":{"data-id":"edit_aws_iam_roles_dc_arch_loc"},"menu":{"hasChildren":false},"tocID":"edit_aws_iam_roles_dc_arch_loc-d23139e5381","topics":[]},{"title":"Updating permissions of AWS IAM roles for data center archival locations","shortdesc":"<p class=\"shortdesc\">Update IAM roles for data center archival location in AWS when a missing permission         status appears for IAM roles in the <span class=\"ph\">RSC<\/span> AWS cloud account page.<\/p>","href":"archival\/update_perm_aws_iam_roles_dc_arch_loc.html","attributes":{"data-id":"update_perm_aws_iam_roles_dc_arch_loc"},"menu":{"hasChildren":false},"tocID":"update_perm_aws_iam_roles_dc_arch_loc-d23139e5395","topics":[]},{"title":"Deleting an AWS IAM role for data center archival locations","shortdesc":"<p class=\"shortdesc\">Delete an IAM role in <span class=\"ph\">RSC<\/span> for data center archival locations in         Amazon S3 when you do not need the IAM role anymore.<\/p>","href":"archival\/delete_aws_iam_role_dc_arch_loc.html","attributes":{"data-id":"delete_aws_iam_role_dc_arch_loc"},"menu":{"hasChildren":false},"tocID":"delete_aws_iam_role_dc_arch_loc-d23139e5409","topics":[]},{"title":"Editing Amazon S3 archival locations for data center workloads","shortdesc":"<p class=\"shortdesc\">Edit the Amazon S3 archival locations for a data center workload to modify archival         location information, including archival location name, cloud account, storage type, and         other advanced settings.<\/p>","href":"archival\/editing_amzn_s3_arch_loc_dc_workloads.html","attributes":{"data-id":"editing_amzn_s3_arch_loc_dc_workloads"},"menu":{"hasChildren":false},"tocID":"editing_amzn_s3_arch_loc_dc_workloads-d23139e5423","topics":[]},{"title":"Amazon S3 archival locations with immutable storage","shortdesc":"<p class=\"shortdesc\">Amazon S3 archival locations with immutable storage prevent modification or deletion         of archived data. Rubrik supports immutable storage on Amazon S3 archival locations both at         the object-level and at the bucket-level.<\/p>","href":"cdm\/amazon_s3_arch_loc_immu_storage.html","attributes":{"data-id":"amazon_s3_arch_loc_immu_storage"},"menu":{"hasChildren":false},"tocID":"amazon_s3_arch_loc_immu_storage-d23139e5435","next":"amazon_s3_arch_loc_immu_storage-d23139e5435"},{"title":"Storage class","shortdesc":"<p class=\"shortdesc\">You can choose the storage class depending on the data access, resiliency, and cost         requirements of your workload. The storage class can be edited after the archival location         is added and the Rubrik cluster applies the new storage class to data that is archived after         a change.<\/p>","href":"cdm\/storage_class.html","attributes":{"data-id":"storage_class"},"menu":{"hasChildren":false},"tocID":"storage_class-d23139e5479","topics":[]},{"title":"Multipart uploads","shortdesc":"<p class=\"shortdesc\">Incomplete partial uploads to Amazon S3 count toward the total storage used by an         account.<\/p>","href":"cdm\/multipart_uploads.html","attributes":{"data-id":"multipart_uploads"},"menu":{"hasChildren":false},"tocID":"multipart_uploads-d23139e5490","topics":[]},{"title":"AWS archive tiering","shortdesc":"<p class=\"shortdesc\">Archive tiering with AWS is used to tier data to the Glacier Flexible Retrieval         Storage Class or Glacier Deep Archive Storage Class based on an SLA Domain policy. <\/p>","href":"cdm\/aws_archive_tiering.html","attributes":{"data-id":"aws_archive_tiering"},"menu":{"hasChildren":false},"tocID":"aws_archive_tiering-d23139e5501","topics":[]},{"title":"Amazon S3 archival location settings","shortdesc":"<p class=\"shortdesc\">Information about the settings required to create an Amazon S3 archival location for         a Rubrik cluster.<\/p>","href":"archival\/arch_s3_archival_location_settings.html","attributes":{"data-id":"arch_s3_archival_location_settings"},"menu":{"hasChildren":false},"tocID":"arch_s3_archival_location_settings-d23139e5512","topics":[]},{"title":"Amazon S3 cloud compute settings","shortdesc":"<p class=\"shortdesc\">Information about the Amazon S3 cloud compute advanced settings required to launch a         transient instance in an AWS Virtual Private Cloud.<\/p>","href":"archival\/arch_s3_cloud_compute_settings.html","attributes":{"data-id":"arch_s3_cloud_compute_settings"},"menu":{"hasChildren":false},"tocID":"arch_s3_cloud_compute_settings-d23139e5523","topics":[]},{"title":"Amazon S3 immutability settings","shortdesc":"<p class=\"shortdesc\">The advanced settings configuration of an Amazon S3 archival location includes an         option to enable bucket-level immutability. Amazon S3 archival locations created for Rubrik         clusters running Rubrik CDM version 9.3.1 and later support object-level immutability, which         is always enabled by default.<\/p>","href":"archival\/arch_s3_immutability_setting.html","attributes":{"data-id":"arch_s3_immutability_setting"},"menu":{"hasChildren":false},"tocID":"arch_s3_immutability_setting-d23139e5534","topics":[]}]}};